    true,nt"url": null,nt"notes": "IDEA Part B Section 618 Table 8 Maintenance
    of Effort and Coordinated Early Intervention Services, Federal Fiscal Year 2011/School
    Year 2011-12 (IDEA Part B Table 8 FFY 2011/SY 2011-12), is a study that is part
    of the IDEA Part B program; program data is available since 2006 at <http://tadnet.public.tadnet.org/pages/712>.
    IDEA Part B Table 8 FFY 2011/SY 2011-12 is a universe cross-sectional report that
    collected data on allocations of IDEA funds; the dollar amount of Maintenance of
    Effort (MOE) reduction; the dollar amount reserved for Coordinated Early Intervening
    Services (CEIS); and the number of children receiving CEIS disaggregated by LEA/educational
    service agency (ESA). State education agencies (SEAs) must submit data required
    by section 618 of the IDEA on the form provided by the Secretary by electronic submission.
    Key statistics produced from IDEA Part B Table 8 FFY 2011/SY 2011-12 provide Maintenance
    of Effort (MOE) reduction, and Coordinated Early Intervening Services (CEIS) dollar
    amounts; the number of children receiving CEIS disaggregated by LEA/educational
    service agencies (ESA) under IDEA Part B, as well as how IDEA funds are used.",nt"license_title":
